@testset "1.2.2.6 P(x) (d x)^m (a+b x^2+c x^4)^p" begin
    @variables A, B, C, a, b, c, d, e, f, g, m, p, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*P(x)*(d*x)^m*(a+b*x^2+c*x^4)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*P(x)*(d*x)^m*(a+b*x^2+c*x^4)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*P2(x)*x^m*(a+b*x^2+c*x^4)^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)*x^2, x, 2, (1/3)*a*A*x^3 + (1/4)*a*B*x^4 + (1/5)*(A*b + a*C)*x^5 + (1/6)*b*B*x^6 + (1/7)*(A*c + b*C)*x^7 + (1/8)*B*c*x^8 + (1/9)*c*C*x^9]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)*x^1, x, 2, (1/2)*a*A*x^2 + (1/3)*a*B*x^3 + (1/4)*(A*b + a*C)*x^4 + (1/5)*b*B*x^5 + (1/6)*(A*c + b*C)*x^6 + (1/7)*B*c*x^7 + (1/8)*c*C*x^8]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)*x^0, x, 2, a*A*x + (1/2)*a*B*x^2 + (1/3)*(A*b + a*C)*x^3 + (1/4)*b*B*x^4 + (1/5)*(A*c + b*C)*x^5 + (1/6)*B*c*x^6 + (1/7)*c*C*x^7]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^1, x, 2, a*B*x + (1/2)*(A*b + a*C)*x^2 + (1/3)*b*B*x^3 + (1/4)*(A*c + b*C)*x^4 + (1/5)*B*c*x^5 + (1/6)*c*C*x^6 + a*A*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^2, x, 2, -((a*A)/x) + (A*b + a*C)*x + (1/2)*b*B*x^2 + (1/3)*(A*c + b*C)*x^3 + (1/4)*B*c*x^4 + (1/5)*c*C*x^5 + a*B*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^3, x, 2, -((a*A)/(2*x^2)) - (a*B)/x + b*B*x + (1/2)*(A*c + b*C)*x^2 + (1/3)*B*c*x^3 + (1/4)*c*C*x^4 + (A*b + a*C)*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^4, x, 2, -((a*A)/(3*x^3)) - (a*B)/(2*x^2) - (A*b + a*C)/x + (A*c + b*C)*x + (1/2)*B*c*x^2 + (1/3)*c*C*x^3 + b*B*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^5, x, 2, -((a*A)/(4*x^4)) - (a*B)/(3*x^3) - (A*b + a*C)/(2*x^2) - (b*B)/x + B*c*x + (1/2)*c*C*x^2 + (A*c + b*C)*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^6, x, 2, -((a*A)/(5*x^5)) - (a*B)/(4*x^4) - (A*b + a*C)/(3*x^3) - (b*B)/(2*x^2) - (A*c + b*C)/x + c*C*x + B*c*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)/x^7, x, 2, -((a*A)/(6*x^6)) - (a*B)/(5*x^5) - (A*b + a*C)/(4*x^4) - (b*B)/(3*x^3) - (A*c + b*C)/(2*x^2) - (B*c)/x + c*C*log(x)]


    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2*x^2, x, 2, (1/3)*a^2*A*x^3 + (1/4)*a^2*B*x^4 + (1/5)*a*(2*A*b + a*C)*x^5 + (1/3)*a*b*B*x^6 + (1/7)*(A*(b^2 + 2*a*c) + 2*a*b*C)*x^7 + (1/8)*B*(b^2 + 2*a*c)*x^8 + (1/9)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^9 + (1/5)*b*B*c*x^10 + (1/11)*c*(A*c + 2*b*C)*x^11 + (1/12)*B*c^2*x^12 + (1/13)*c^2*C*x^13]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2*x^1, x, 2, (1/2)*a^2*A*x^2 + (1/3)*a^2*B*x^3 + (1/4)*a*(2*A*b + a*C)*x^4 + (2/5)*a*b*B*x^5 + (1/6)*(A*(b^2 + 2*a*c) + 2*a*b*C)*x^6 + (1/7)*B*(b^2 + 2*a*c)*x^7 + (1/8)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^8 + (2/9)*b*B*c*x^9 + (1/10)*c*(A*c + 2*b*C)*x^10 + (1/11)*B*c^2*x^11 + (1/12)*c^2*C*x^12]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2*x^0, x, 2, a^2*A*x + (1/2)*a^2*B*x^2 + (1/3)*a*(2*A*b + a*C)*x^3 + (1/2)*a*b*B*x^4 + (1/5)*(A*(b^2 + 2*a*c) + 2*a*b*C)*x^5 + (1/6)*B*(b^2 + 2*a*c)*x^6 + (1/7)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^7 + (1/4)*b*B*c*x^8 + (1/9)*c*(A*c + 2*b*C)*x^9 + (1/10)*B*c^2*x^10 + (1/11)*c^2*C*x^11]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^1, x, 2, a^2*B*x + (1/2)*a*(2*A*b + a*C)*x^2 + (2/3)*a*b*B*x^3 + (1/4)*(A*(b^2 + 2*a*c) + 2*a*b*C)*x^4 + (1/5)*B*(b^2 + 2*a*c)*x^5 + (1/6)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^6 + (2/7)*b*B*c*x^7 + (1/8)*c*(A*c + 2*b*C)*x^8 + (1/9)*B*c^2*x^9 + (1/10)*c^2*C*x^10 + a^2*A*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^2, x, 2, -((a^2*A)/x) + a*(2*A*b + a*C)*x + a*b*B*x^2 + (1/3)*(A*(b^2 + 2*a*c) + 2*a*b*C)*x^3 + (1/4)*B*(b^2 + 2*a*c)*x^4 + (1/5)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^5 + (1/3)*b*B*c*x^6 + (1/7)*c*(A*c + 2*b*C)*x^7 + (1/8)*B*c^2*x^8 + (1/9)*c^2*C*x^9 + a^2*B*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^3, x, 2, -((a^2*A)/(2*x^2)) - (a^2*B)/x + 2*a*b*B*x + (1/2)*(A*(b^2 + 2*a*c) + 2*a*b*C)*x^2 + (1/3)*B*(b^2 + 2*a*c)*x^3 + (1/4)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^4 + (2/5)*b*B*c*x^5 + (1/6)*c*(A*c + 2*b*C)*x^6 + (1/7)*B*c^2*x^7 + (1/8)*c^2*C*x^8 + a*(2*A*b + a*C)*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^4, x, 2, -((a^2*A)/(3*x^3)) - (a^2*B)/(2*x^2) - (a*(2*A*b + a*C))/x + (A*(b^2 + 2*a*c) + 2*a*b*C)*x + (1/2)*B*(b^2 + 2*a*c)*x^2 + (1/3)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^3 + (1/2)*b*B*c*x^4 + (1/5)*c*(A*c + 2*b*C)*x^5 + (1/6)*B*c^2*x^6 + (1/7)*c^2*C*x^7 + 2*a*b*B*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^5, x, 2, -((a^2*A)/(4*x^4)) - (a^2*B)/(3*x^3) - (a*(2*A*b + a*C))/(2*x^2) - (2*a*b*B)/x + B*(b^2 + 2*a*c)*x + (1/2)*(2*A*b*c + (b^2 + 2*a*c)*C)*x^2 + (2/3)*b*B*c*x^3 + (1/4)*c*(A*c + 2*b*C)*x^4 + (1/5)*B*c^2*x^5 + (1/6)*c^2*C*x^6 + (A*(b^2 + 2*a*c) + 2*a*b*C)*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^6, x, 2, -((a^2*A)/(5*x^5)) - (a^2*B)/(4*x^4) - (a*(2*A*b + a*C))/(3*x^3) - (a*b*B)/x^2 - (A*(b^2 + 2*a*c) + 2*a*b*C)/x + (2*A*b*c + (b^2 + 2*a*c)*C)*x + b*B*c*x^2 + (1/3)*c*(A*c + 2*b*C)*x^3 + (1/4)*B*c^2*x^4 + (1/5)*c^2*C*x^5 + B*(b^2 + 2*a*c)*log(x)]
    @test_int [(A + B*x + C*x^2)*(a + b*x^2 + c*x^4)^2/x^7, x, 2, -((a^2*A)/(6*x^6)) - (a^2*B)/(5*x^5) - (a*(2*A*b + a*C))/(4*x^4) - (2*a*b*B)/(3*x^3) - (A*(b^2 + 2*a*c) + 2*a*b*C)/(2*x^2) - (B*(b^2 + 2*a*c))/x + 2*b*B*c*x + (1/2)*c*(A*c + 2*b*C)*x^2 + (1/3)*B*c^2*x^3 + (1/4)*c^2*C*x^4 + (2*A*b*c + (b^2 + 2*a*c)*C)*log(x)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^4*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4), x, 13, ((A*c - b*C)*x)/c^2 + (B*x^2)/(2*c) + (C*x^3)/(3*c) - ((A*b*c - b^2*C + a*c*C - (A*c*(b^2 - 2*a*c) - b*(b^2 - 3*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(5/2)*sqrt(b - sqrt(b^2 - 4*a*c))) - ((A*b*c - b^2*C + a*c*C + (A*c*(b^2 - 2*a*c) - b*(b^2 - 3*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(5/2)*sqrt(b + sqrt(b^2 - 4*a*c))) - (B*(b^2 - 2*a*c)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c^2*sqrt(b^2 - 4*a*c)) - (b*B*log(a + b*x^2 + c*x^4))/(4*c^2)]
    @test_int [x^3*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4), x, 12, (B*x)/c + (C*x^2)/(2*c) - (B*(b - (b^2 - 2*a*c)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b - sqrt(b^2 - 4*a*c))) - (B*(b + (b^2 - 2*a*c)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b + sqrt(b^2 - 4*a*c))) + ((A*b*c - b^2*C + 2*a*c*C)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c^2*sqrt(b^2 - 4*a*c)) + ((A*c - b*C)*log(a + b*x^2 + c*x^4))/(4*c^2)]
    @test_int [x^2*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4), x, 11, (C*x)/c + ((A*c - b*C - (A*b*c - (b^2 - 2*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((A*c - b*C + (A*b*c - b^2*C + 2*a*c*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*c^(3/2)*sqrt(b + sqrt(b^2 - 4*a*c))) + (b*B*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c*sqrt(b^2 - 4*a*c)) + (B*log(a + b*x^2 + c*x^4))/(4*c)]
    @test_int [x^1*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4), x, 10, -((B*sqrt(b - sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b^2 - 4*a*c))) + (B*sqrt(b + sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b^2 - 4*a*c)) - ((2*A*c - b*C)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*c*sqrt(b^2 - 4*a*c)) + (C*log(a + b*x^2 + c*x^4))/(4*c)]
    @test_int [x^0*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4), x, 8, ((C + (2*A*c - b*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((C - (2*A*c - b*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*sqrt(c)*sqrt(b + sqrt(b^2 - 4*a*c))) - (B*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/sqrt(b^2 - 4*a*c)]
    @test_int [(A + B*x + C*x^2)/(x^1*(a + b*x^2 + c*x^4)), x, 12, (sqrt(2)*B*sqrt(c)*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(b^2 - 4*a*c)*sqrt(b - sqrt(b^2 - 4*a*c))) - (sqrt(2)*B*sqrt(c)*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(b^2 - 4*a*c)*sqrt(b + sqrt(b^2 - 4*a*c))) + ((A*b - 2*a*C)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*a*sqrt(b^2 - 4*a*c)) + (A*log(x))/a - (A*log(a + b*x^2 + c*x^4))/(4*a)]
    @test_int [(A + B*x + C*x^2)/(x^2*(a + b*x^2 + c*x^4)), x, 13, -(A/(a*x)) - (sqrt(c)*(A + (A*b - 2*a*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*a*sqrt(b - sqrt(b^2 - 4*a*c))) - (sqrt(c)*(A - (A*b - 2*a*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*a*sqrt(b + sqrt(b^2 - 4*a*c))) + (b*B*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*a*sqrt(b^2 - 4*a*c)) + (B*log(x))/a - (B*log(a + b*x^2 + c*x^4))/(4*a)]
    @test_int [(A + B*x + C*x^2)/(x^3*(a + b*x^2 + c*x^4)), x, 13, -(A/(2*a*x^2)) - B/(a*x) - (B*sqrt(c)*(1 + b/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*a*sqrt(b - sqrt(b^2 - 4*a*c))) - (B*sqrt(c)*(1 - b/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*a*sqrt(b + sqrt(b^2 - 4*a*c))) - ((A*(b^2 - 2*a*c) - a*b*C)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(2*a^2*sqrt(b^2 - 4*a*c)) - ((A*b - a*C)*log(x))/a^2 + ((A*b - a*C)*log(a + b*x^2 + c*x^4))/(4*a^2)]


    @test_int [x^4*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4)^2, x, 11, ((2*A*c - b*C)*x)/(2*c*(b^2 - 4*a*c)) + (B*x^2*(2*a + b*x^2))/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) - (x^3*(A*b - 2*a*C + (2*A*c - b*C)*x^2))/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) + ((A*b*c + (b^2 - 6*a*c)*C - (A*c*(b^2 + 4*a*c) + b*(b^2 - 8*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(2*sqrt(2)*c^(3/2)*(b^2 - 4*a*c)*sqrt(b - sqrt(b^2 - 4*a*c))) + ((A*b*c + (b^2 - 6*a*c)*C + (A*c*(b^2 + 4*a*c) + b*(b^2 - 8*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(2*sqrt(2)*c^(3/2)*(b^2 - 4*a*c)*sqrt(b + sqrt(b^2 - 4*a*c))) + (2*a*B*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(b^2 - 4*a*c)^(3/2)]
    @test_int [x^3*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4)^2, x, 10, (B*x*(2*a + b*x^2))/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) + (a*(2*A*c - b*C) + (A*b*c - b^2*C + 2*a*c*C)*x^2)/(2*c*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) + (B*(b - (b^2 + 4*a*c)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(2*sqrt(2)*sqrt(c)*(b^2 - 4*a*c)*sqrt(b - sqrt(b^2 - 4*a*c))) + (B*(b^2 + 4*a*c + b*sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(2*sqrt(2)*sqrt(c)*(b^2 - 4*a*c)^(3/2)*sqrt(b + sqrt(b^2 - 4*a*c))) - ((A*b - 2*a*C)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(b^2 - 4*a*c)^(3/2)]
    @test_int [x^2*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4)^2, x, 10, (B*(2*a + b*x^2))/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) - (x*(A*b - 2*a*C + (2*A*c - b*C)*x^2))/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) - ((2*A*c - b*C - (4*A*b*c - (b^2 + 4*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(2*sqrt(2)*sqrt(c)*(b^2 - 4*a*c)*sqrt(b - sqrt(b^2 - 4*a*c))) - ((2*A*c - b*C + (4*A*b*c - (b^2 + 4*a*c)*C)/sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(2*sqrt(2)*sqrt(c)*(b^2 - 4*a*c)*sqrt(b + sqrt(b^2 - 4*a*c))) - (b*B*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(b^2 - 4*a*c)^(3/2)]
    @test_int [x^1*(A + B*x + C*x^2)/(a + b*x^2 + c*x^4)^2, x, 10, -((B*x*(b + 2*c*x^2))/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4))) - (A*b - 2*a*C + (2*A*c - b*C)*x^2)/(2*(b^2 - 4*a*c)*(a + b*x^2 + c*x^4)) + (B*sqrt(c)*(2*b - sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b - sqrt(b^2 - 4*a*c))))/(sqrt(2)*(b^2 - 4*a*c)^(3/2)*sqrt(b - sqrt(b^2 - 4*a*c))) - (B*sqrt(c)*(2*b + sqrt(b^2 - 4*a*c))*atan((sqrt(2)*sqrt(c)*x)/sqrt(b + sqrt(b^2 - 4*a*c))))/(sqrt(2)*(b^2 - 4*a*c)^(3/2)*sqrt(b + sqrt(b^2 - 4*a*c))) + ((2*A*c - b*C)*atanh((b + 2*c*x^2)/sqrt(b^2 - 4*a*c)))/(b^2 - 4*a*c)^(3/2)]
